import React from "react";
import ContentTemplate from "../ContentTemplate";

function About() {
  return (
    <div>
      <h1>About ProRide</h1>
      <div className="paragraphsDiv">

      </div>
      <img
        src="https://static.wixstatic.com/media/0583da_ca68997c26da49b0985563dc25fd6bc9~mv2_d_3264_2448_s_4_2.jpg/v1/crop/x_813,y_514,w_2451,h_1836/fill/w_488,h_488,al_c,q_80,usm_0.66_1.00_0.01/0583da_ca68997c26da49b0985563dc25fd6bc9~mv2_d_3264_2448_s_4_2.jpg"
        alt="kid on bike"
      />
    </div>
  );
}

<ContentTemplate
  header={servicesData[0].name}
  header2={servicesData[0].header2}
  description={servicesData[0].description}
  flyer={servicesData[0].flyer}
  flyer2={servicesData[0].flyer2}
/>;

export default About;
